/* eslint-disable */
import Vue from "vue";
import Vuex from "vuex";
Vue.use(Vuex);

const state = {
    roomList: [],
};

const getters = {
    roomList(state) {
        return state.roomList;
    },
};

const mutations = {

    setRoomList(state, value) {
        state.roomList = value;
    },
};

const actions = {

};


export const store = new Vuex.Store({
    state: {
        currencies: [],
    },
    getters,
    mutations,
    actions
});
